jobInfo.postDescription:
1、负责公司项目的开发和维护工作。
2、负责生产系统支持，分析并解决系统bug，保障系统稳定运行；
3、根据任务计划独立按时完成高质量的编码和测试工作。
4、负责公司数据仓库平台建设
5、负责公司硬件管理平台开发、厂家对接及设备联调测试
工作要求
1. 计算机相关专业本科及以上学历;
2. 二年及以上项目开发经验;
3. 熟练掌握Java语言和面向对象程序设计，能熟练使用IntelliJIDEA或Eclipse等IDE工程开发;
4. 熟练掌握Springboot、MyBatis或者Hibernate等框架;
5. 熟悉MySql、Oracle数据库，能熟练使用各种SQL语句;
6. 熟练掌握SVN/GIT项目版本管理工具;
7. 熟悉Html/Javascript/Css以及Vue、jQuery等前端框架者优先;
8. 思路清晰，思维敏捷，有快速的学习能力;
9. 具备良好的表达和沟通能力，富有团队合作精神;
10. 熟悉Java网络编程，多线程编程;
11. 具备物联网IOT平台、大数据平台开发经验优先；
